import React, { Component } from 'react';
import Portal from '../Common/portal'
import Copyright from "../Common/Copyright";


class AboutUs extends Component {
    render() {
        return (
            <div>
          <Portal 
          PortalName="Admin Portal"
          SideBarName="Dashboard"
          PersonName={name}
          
          // Heading 01
          mainoption1="Manage Doctor"
          smalloption1="Add Doctor"

          showOption2="true"
          smalloption2="Delete Doctor"

          showOption3="true"
          smalloption3="Doctor History"

          // Heading 02
          mainoption2="Manage Patients"

          showOption4="true"
          smalloption4="Add Patient"

          showOption5="true"
          smalloption5="Delete Patient"

          showOption6="true"
          smalloption6="Patient History"



          // Heading 03
          mainoption3="Account"
         
          showOption7="true"
          smalloption7="Change Account Info"

          showOption8=""
          smalloption8=""
          

        //   Upload Image
          uploadImage=""

        //   Add Doc-Patient
         addpatdoc="true"
         addtype="Doctor"


          
          />
      <Copyright />
         
         </div>
        )}}

        export default Add
